import React from "react";
import Header from "./components/header";
import fetchJsonp from "fetch-jsonp";

useEffect(() => {
    setTimeout(() => {
        fetchJsonp(
            "https://kayak.com/h/mobileapis/directory/airlines/homework",
            {
                jsonpCallback: "jsonp",
            }
        )
            .then((res) => res.json())
            .then(
                (res) => {
                    if (alliance.length === 0) {
                        console.log(res);
                        setFilterItems(res);
                    } else {
                        setFilterItems(
                            res.filter((item) =>
                                alliance.some((category) =>
                                    [item.alliance].flat().includes(category)
                                )
                            )
                        );
                    }
                },
                (error) => {
                    console.log(error);
                    setIsLoaded(true);
                    setError(error);
                }
            );
    }, 1000);
}, [alliance]);

function App() {
    return (
        <div>
            <Header />
        </div>
    );
}

export default App;
